Description:
Become effortlessly cool and confident when you’re sporting Bentley, a powerful men’s cologne. This captivating fragrance gives you the strength and determination to get through any occasion. Top notes of spicy black pepper, sharp bay leaf and bergamot introduce the scent with energizing and refreshing ingredients, while heart notes of clary sage, cinnamon, rum, and various woody notes infuse the blend with accords that are distinctive and wholly masculine. Base notes of heady patchouli, benzoin, rich cedar, and potent leather round out the mix for a robust and hearty cologne that has heads turning immediately after you arrive.

&nbsp;

About the brand:

&nbsp;

For a century, Bentley Motors has been manufacturing luxury cars that combine excellence, expertise, tradition and modernity. The Bentley Fragrances perfume collection draws its inspiration from this prestigious world, sharing the same vision of style in which authenticity, elegance and refinement are pushed to their extremes. Since its launch in 2013, Bentley Fragrances has been met with remarkable success in the Middle East, Europe, the Americas and Asia. Its olfactive signature, made up of premium ingredients, has inspired the most seasoned perfume lovers across the world.
